import React, { Component } from "react";
import axios from "axios";
export default class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      posts: [],
    };
  }

  componentDidMount() {
    axios
      .get("http://localhost:8084/api/v1/employees")
      .then((response) => {
        const employees = response.data;
        console.log(response);
      });
    }
  render() {
    return (
      <>
